package modchu.lib.forge.mc220_222;import java.util.HashMap;import net.minecraft.util.DamageSource;import net.minecraft.util.SoundEvent;import net.minecraft.world.World;public class Modchu_EntityPlayerDummy extends modchu.lib.forge.mc190_222.Modchu_EntityPlayerDummy {	public Modchu_EntityPlayerDummy(World world) {		super(world);	}	public Modchu_EntityPlayerDummy(HashMap<String, Object> map) {		super(map);	}	@Override	public void travel(float par1, float par2, float par3) {		if (master != null) master.travel(par1, par2, par3);		else super.travel(par1, par2, par3);	}	@Override	public void superTravel(float par1, float par2, float par3) {		super.travel(par1, par2, par3);	}	@Override	public SoundEvent getHurtSound(DamageSource damageSource) {		if (master != null) return (SoundEvent) master.getHurtSound(damageSource);		return super.getHurtSound(damageSource);	}}